import React from 'react';

const UserTypeScreen = ({ history }) => {
	return (
		<div className="container">
			<div className="row">
				<div className="col-sm-6" style={{ backgroundColor: 'whitesmoke' }}>
					<h1>Basic</h1>
					<p>
						<ul>
							<li>Add to Cart</li>
							<li>Buy Products Online</li>
						</ul>
					</p>
				</div>
				<div className="col-sm-6" style={{ backgroundColor: 'white' }}>
					<h1> Premium </h1>
					<p>Sed ut perspiciatis...</p>
				</div>
			</div>
		</div>
	);
};

export default UserTypeScreen;
